DROP DATABASE IF EXISTS thesis_distributed;
CREATE DATABASE thesis_distributed;
USE thesis_distributed;

CREATE TABLE professor (
  prof_id INT NOT NULL,
  prof_name VARCHAR(50),
  prof_surname VARCHAR(50),
  prof_email VARCHAR(50) NOT NULL,
  prof_topic VARCHAR(50),
  prof_landline VARCHAR(15),
  prof_mobile VARCHAR(15),
  prof_department VARCHAR(50),
  prof_university VARCHAR(50),
  prof_all_thesis_document BLOB,
  passexecuted BOOLEAN DEFAULT FALSE,
  PRIMARY KEY (prof_id),
  UNIQUE KEY (prof_email)
);

