CREATE TABLE committee (
  co_id INT AUTO_INCREMENT,
  co_prof_1_id INT NULL,
  co_prof_2_id INT NULL,
  co_supervising_prof_id INT NOT NULL,
  co_st_id INT NOT NULL,
  co_topic_assignment_petition LONGBLOB NULL,
  co_grade_document LONGBLOB NULL,
  co_presentation_date DATE NULL,
  co_the_examination ENUM('Active','Passive'),
  co_the_exam_date DATE NULL,
  co_the_exam_time TIME NULL,
  co_the_exam_way ENUM('remote', 'in person') DEFAULT NULL,
  co_the_exam_remote_url VARCHAR(100) NULL,
  co_the_exam_in_person_class VARCHAR(50) NULL, 
  co_thesis_request_document_unsigned BLOB NULL,
  co_prof_1_grade INT NULL,
  co_prof_2_grade INT NULL,
  co_supervising_prof_grade INT NULL,
  PRIMARY KEY (co_id),
  FOREIGN KEY (co_prof_1_id) REFERENCES professor (prof_id),
  FOREIGN KEY (co_prof_2_id) REFERENCES professor (prof_id),
  FOREIGN KEY (co_supervising_prof_id) REFERENCES professor (prof_id),
  FOREIGN KEY (co_st_id) REFERENCES student (st_id),
  CHECK (co_prof_1_id <> co_prof_2_id)
);

